import React from 'react';
import classes from './NavBar.module.css';

function NavBar() {
    return (
        <nav className={classes.nav}>
            <a href="#r" className='item'>Profile</a>
            <div></div>
            <a href="#r" className='item'>Messages</a>
            <div></div>
            <a href="#r" className='item'>News</a>
            <div></div>
            <a href="#r" className='item'>Music</a>
            <div></div>
            <a href="#r" className='item'>Settings</a>
        </nav>
    )
}

export default NavBar;
